INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 2, 0, "お！\nあそこに困ってそうな人発見！", "春咲 ひより", 0, 1001, 1, 1, 1);
