INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("出雲宮子なのー", 0, 0, 1.5, "食べ物の恨みは怖いのー", 0, 2, 0, "プリンたべたいのー", "出雲 宮子", 0, 1007, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ボクは虹村雪。", 0, 0, 1.4, "いいよ。\n見られることは運命さ…", 0, 2, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", 0, 1008, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("フッ…聞いて後悔するがいい！", 0, 0, 1.4, "人呼んで「疾風の冥姫」!!", 0, 2, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", 0, 1009, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1.5, "ほんまおおきにやわ～♪", 0, 2, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", 0, 1010, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("衣之咲璃乃です！", 0, 0, 1.4, "ここで会ったが\n100年目～！", 0, 2, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", 0, 1011, 1, 1, 1);
