INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1.5, "ふぇぇぇぇぇん……", 0, 2, 0, "あの……\nふぇ……", "栗林 くるみ", 0, 1021, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("風宮よりです。\nあああああ！", 0, 0, 1.4, "なんてありがとうございます！", 0, 2, 0, "こんな私に貴重な時間を\n割いていただき、", "風宮 より", 0, 1022, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1.5, "私こっち行きたいー\nね、早く早くー", 0, 2, 0, "おにいちゃんどこいくの？\nえ？", "北条 綾音", 0, 1023, 1, 1, 1);
