INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("……クスクス…私は\n…倉石恵理子……", 0, 0, 1.4, "離しませんわ………\n絶対に…!!", 0, 2, 0, "あなたは…運命の……\n伴侶……", "倉石 恵理子", 0, 1027, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1.4, "…そうでしょ？？", 0, 2, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", 0, 1028, 1, 1, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("桜井望だよ！\nよろしくねっ", 0, 0, 1.4, "あはは、\n私もまだまだだなぁ～", 0, 2, 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", 0, 1029, 1, 1, 1);
